import React , {Component} from 'react'
import ReactDOM from 'react-dom';
import { Container, Row, Col , Button } from 'reactstrap';


class CalculatorButton extends Component{

  render(){

    const { calculate} = this.props

    return(

      <div className="button-list">
      <Row className="justify-content-md-center">
          <Col md={2}></Col>
          <Col md="auto"><Button value="7" onClick={ e => calculate(e.this.value)}>7</Button>
          <Button value="8" onClick={ e => calculate(e.this.value)}>8</Button>
          <Button value="9" onClick={ e => calculate(e.this.value)}>9</Button>
          <Button value="+" onClick={ e => calculate(e.this.value)}>+</Button></Col>
          <Col md={2}></Col>

      </Row>

      </div>
    )

  }


}



export default CalculatorButton ;
